import "./style.css";

const Footer = () => {
    return ( 
        <footer className="footer">
            <div className="footer__content">
            <p className="footer_context">
            Виконано в <a href="https://prometheus.org.ua/" target="_blank" rel="noopener noreferrer" > Prometheus</a> © 2023
            </p>
            </div>
        </footer>

     );
}

export default Footer;
